给大家推荐一种硬核走迷宫方法:

1.打开画图

2.将迷宫的入口和出口封住

3.在迷宫的入口处染色

例如：

![](https://cdn.luogu.com.cn/upload/image_hosting/98rvk5ml.png)

4.如果迷宫出口处被染上色，说明这个迷宫可以走通（例如$A$,$C$），反之则不行（如$B$,$D$）

用如上方法可以得出答案，输出即可

程序如下：
```cpp
#include<bits/stdc++.h>
using namespace std;
int main()
{
    puts("ACEFGHNPQSYZ");
    return 0;
}
```

[题目传送门](https://www.luogu.com.cn/problem/AT3743)

思路：

显然，我们不可能用程序从图片中读取信息。那么我们只能用画图软件对空白进行填充。如果颜色填充了从入口到出口的路，那就说明能走通，否则就不能。

下面是结果：

![](https://cdn.luogu.com.cn/upload/image_hosting/98rvk5ml.png)

显然，可以走通的有 ACEFGHNPQSYZ。那么我们输出这些就好啦。

AC Code：

```cpp
#include<bits/stdc++.h>
using namespace std;
int main()
{
    ios::sync_with_stdio(0);
    cin.tie(0);
    cout.tie(0);
    cout<<"ACEFGHNPQSYZ\n";
    return 0;
}
```


求求给个赞吧！蟹蟹！

一种简单的思路

1. 将图片复制下来，用画图打开。

![](https://cdn.luogu.com.cn/upload/image_hosting/lqn74eg0.png)

2. 封住其中一条口。

![](https://cdn.luogu.com.cn/upload/image_hosting/kmskfub2.png)

3. 按一下填充，随手一点。

![](https://cdn.luogu.com.cn/upload/image_hosting/4h1526j9.png)

答案就出现了！！！

#### Code

```
#include<bits/stdc++.h>
using namespace std;
int main()
{
    cout << "ACEFGHNPQSYZ";
    return 0;
}
```

完结撒花。
